import React from "react";
import "./Watch.css";
const Watch = () => {
  return (
    <div className="Watch">
      <div className="row">
        <div className="video__watch left__bar" style={{ flex: "0.6" }}>
          <div>
            <iframe
              width="706"
              height="397"
              src="https://www.youtube.com/embed/2QyG3sPBrm4"
              title="YouTube video player"
              frameborder="0"
              allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
              allowfullscreen
            ></iframe>
          </div>
        </div>

        <div className="video__watch right__bar" style={{ flex: "0.4" }}></div>
      </div>
    </div>
  );
};

export default Watch;
